import React, { Component } from 'react'
import {Nav, Navbar} from 'react-bootstrap'

export default class Navigation extends React.Component {
  render() {
    return (
      <Navbar expand="lg" bg="light">
        <Navbar.Brand href="#home"></Navbar.Brand>

          <nav>
            <ul>
              <li>About Me</li>
              <li>Software</li>
              <li>Hardware</li>
              <li>Music</li>
              <li>Blog</li>
              <li>Contact</li>
            </ul>
          </nav>
      </Navbar>

    );
  }
}
